// frontend/src/pages/MovieList.jsx
import React, { useEffect, useState } from 'react';
import API from '../api';
import { Link } from 'react-router-dom';

export default function MovieList() {
  const [movies, setMovies] = useState([]);
  const [page, setPage] = useState(1);
  const [next, setNext] = useState(null);
  const [prev, setPrev] = useState(null);

  // Fetch movies with pagination
  const fetchMovies = async (p = 1) => {
    try {
      const res = await API.get(`movies/?page=${p}`);
      setMovies(res.data.results);
      setNext(res.data.next);
      setPrev(res.data.previous);
      setPage(p);
    } catch (err) {
      console.error('Error fetching movies:', err);
    }
  };

  useEffect(() => {
    fetchMovies(1);
  }, []);

  useEffect(() => {
    const handler = () => fetchMovies(1);
    window.addEventListener('movie:added', handler);
    return () => window.removeEventListener('movie:added', handler);
  }, []);

  return (
    <div className="min-h-screen px-6 py-8 bg-gradient-to-br from-yellow-200 via-yellow-300 to-yellow-400 font-sans">

      {/* Title */}
      <h2 className="text-4xl font-extrabold mb-8 text-center bg-gradient-to-r from-red-900 via-orange-600 to-yellow-500 bg-clip-text text-transparent">
        Movies Catalog
      </h2>

      {/* Movie Grid: 2 rows x 4 columns */}
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-8">
        {movies.map((m) => (
          <div
            key={m.id}
            className="rounded-xl bg-white/80 backdrop-blur-md shadow-lg hover:shadow-2xl transition transform hover:-translate-y-1"
          >
            <Link to={`/movie/${m.id}`}>
              {m.poster ? (
                <img
                  src={m.poster}
                  alt={m.title}
                  className="w-full h-56 object-cover rounded-t-xl"
                />
              ) : (
                <div className="w-full h-56 bg-gray-300 flex items-center justify-center text-gray-600 rounded-t-xl">
                  No Image
                </div>
              )}
              <div className="p-4">
                <h3 className="text-xl font-semibold mb-2 text-gray-900">{m.title}</h3>
                <p className="text-black font-medium">
                  Rating: <span className="text-red-600">{m.rating || "N/A"}</span>
                </p>
              </div>
            </Link>
          </div>
        ))}
      </div>

      {/* Pagination */}
      <div className="mt-10 flex items-center justify-center gap-6">
        <button
          onClick={() => fetchMovies(page - 1)}
          disabled={!prev}
          className={`px-5 py-2 rounded-lg font-semibold text-white transition ${
            prev ? "bg-gradient-to-r from-gray-800 to-gray-900 hover:from-gray-700 hover:to-gray-800 shadow-md" 
                 : "bg-gray-400 cursor-not-allowed"
          }`}
        >
          Previous
        </button>

        <span className="text-lg font-bold text-gray-900">Page {page}</span>

        <button
          onClick={() => fetchMovies(page + 1)}
          disabled={!next}
          className={`px-5 py-2 rounded-lg font-semibold text-white transition ${
            next ? "bg-gradient-to-r from-gray-800 to-gray-900 hover:from-gray-700 hover:to-gray-800 shadow-md" 
                 : "bg-gray-400 cursor-not-allowed"
          }`}
        >
          Next
        </button>
      </div>
    </div>
  );
}
